import React from 'react';
import ReactDOM from 'react-dom';
import ('./index.css');



function Card(){
    return (
        <div className="cards">
        <div className="card">
            <img src="" alt="myPic" className="card__img"/>
            <div className="card__info">
                <span className="card__category"> A Netflix Orignal Series</span>
                <h3 className="card__title"> Dark </h3>
                <a href="" target="_blank">
                    <button>Watch Now</button>
                </a>
            </div>
        </div>
    </div>
    )
}

ReactDOM.render( 
    <>
    <Card imgsrc="https://wallpapercave.com/wp.wp4056410.jpg"
    title="A Netflix Orignal Series"
    sname="Dark"
    link="https://www.netflix.com/in/title/80990668?source=35"/>
    <Card/>
    <Card/>
    </>,
    document.getElementById('root')
    );
